INSERT INTO FORM_TEMPLATE (ID_, COMPONENTID_, CREATEBY_, CREATEDATE_, DELETEFLAG_, NAME_, TEMPLATE_, TYPE_) VALUES (1, 21, 'admin', '2015-04-27 16:05:29', 0, 's', '     kendo.bind(jQuery("#{{id}}"), kendo.observable({
        isVisible: {{visible}},
        onSave: {{onsave}},
	onChange: {{clickfunction}},
	onDataBound: {{ondatabound}},
        products: new kendo.data.DataSource({
            schema: {
		model:{
			id:"{{schemaid}}",
			fields:{{schemafields}}	
		},
                data : "data",
		total : "total",
		errors: "error"
            },
	    aggregate:{{datacolunmstat}},
            batch: true,
	    pageSize:{{pagesize}},
	    serverGrouping : {{servergrouping}},
            serverFiltering : {{serverfiltering}},
	    serverPaging : {{serverpaging}},
	    serverSorting : {{serversorting}},
	    error : function(e) {
		alert(''操作失败'');
	    },
            transport: {
                read: {
                    url: contextPath+"/mx/form/data/gridData",
                    dataType: "json",
		    contentType : "application/json",
		    type : "POST",
		    data : {
			rid:''{{ruleid}}'',
			parentId: JSON.parse(pageParameters).parentId || '''' ,
		    }
                },
		create: {
                    url: contextPath+"/mx/form/data/createData",
                    dataType: "json",
		    contentType : "application/json",
		    type : "POST",
		    data : {
			rid:''{{ruleid}}''
		    }
                },
		update: {
                    url: contextPath+"/mx/form/data/createData",
                    dataType: "json",
		    contentType : "application/json",
		    type : "POST",
		    data : {
			rid:''{{ruleid}}''
		    }
                },
		destroy: {
                    url: contextPath+"/mx/form/data/deleteData",
                    dataType: "json",
		    contentType : "application/json",
		    type : "POST",
		    data : {
			rid:''{{ruleid}}''
		    }
                },
                parameterMap: function(options, operation) {
		    return kendo.stringify(options);
                }
            }
        })
    }));
    {{showtooltip}}
    var {{id}}CheckedIds = {};
    function {{id}}SelectRow(){
	var that = this ;
	glafGrid.selectRow(that,"{{id}}",{{id}}CheckedIds);
    }
    function {{id}}SelectAllRow(){
	var that = this ;
	glafGrid.selectAllRow(that,"{{id}}",{{id}}CheckedIds);
    }
    function {{id}}OnDataBound(e){
	glafGrid.onDataBound(e,"{{id}}",{{id}}CheckedIds);
    }
    $("#{{id}}").data("kendoGrid").table.on("click", ".{{id}}_checkbox", {{id}}SelectRow);
    $("#{{id}}").data("kendoGrid").thead.on("click", ".{{id}}_checkbox_All", {{id}}SelectAllRow);
{{dblclickfunction}}
   
', 'data');
