INSERT INTO FORM_TEMPLATE (ID_, COMPONENTID_, CREATEBY_, CREATEDATE_, DELETEFLAG_, NAME_, TEMPLATE_, TYPE_) VALUES (3, 33, 'admin', '2015-04-30 17:40:14', 0, 'source', 'glafZtree.init(''{{id}}'', {
	async : {
		enable : true,
		url : contextPath+''/mx/form/treeData/treeData'',
		autoParam : [ ''{{indexkey}}=pid'' ],
		otherParam : {''rid'':''{{ruleid}}''},
		dataFilter : function(treeId, parentNode, childNodes) {
			if (!childNodes)
				return null;
			for (var i = 0, l = childNodes.length; i < l; i++) {
				childNodes[i].id = childNodes[i].{{idtable}};
				childNodes[i].name = childNodes[i].{{namekey}};
				childNodes[i].indexkey = childNodes[i].{{indexkey}};
				childNodes[i].idkey = childNodes[i].{{idkey}};
				childNodes[i].pidkey = childNodes[i].{{pidkey}};
				if(''{{icon}}''!='''' && childNodes[i][''{{icon}}'']){
					childNodes[i].icon = contextPath+childNodes[i][''{{icon}}''];
				};
				if(''{{iconopen}}''!='''' && childNodes[i][''{{iconopen}}'']){
					childNodes[i].iconOpen = contextPath+childNodes[i][''{{iconopen}}''];
				};
				if(''{{iconclose}}''!='''' && childNodes[i][''{{iconclose}}'']){
					childNodes[i].iconClose = contextPath+childNodes[i][''{{iconclose}}''];
				};
			}
			return childNodes;
		},
	},
	view: {
		dblClickExpand: {{dblclickexpand}},  
		showLine: {{showline}},
		showIcon: {{showicon}},
		selectedMulti: {{selectedmulti}},
		expandSpeed : ''{{expandspeed}}''    
	},
	data: {
		simpleData: {
			enable:{{simpledataenable}},
			idKey: ''{{indexkey}}'',
			pIdKey: ''{{pidkey}}'',
			rootPId: ''-1''
		}
	},
	check:{
		enable:{{checkenable}},
		chkStyle:''{{chkstyle}}'',
		chkboxType: { "Y": "s", "N": "s" },
	},
	callback: {
		beforeClick: {{ztreeBeforeClick}},
		beforeRename: function(treeId, treeNode, newName, isCancel ) {
			return glafZtree.beforeRename(treeId, treeNode, newName, isCancel, ''{{ruleid}}'');
		},
		beforeRemove: function(treeId, treeNode) {
			return glafZtree.beforeRemove(treeId, treeNode,''{{ruleid}}'');
		},
		beforeDrop: function(treeId, treeNodes, targetNode, moveType,isCopy) {
			return glafZtree.beforeDrop(treeId, treeNodes, targetNode, moveType,isCopy,''{{ruleid}}'') 
		},
		onClick: function(event, treeId, treeNode,clickFlag){
			{{click}}
		},
                beforeAsync: function(treeId, treeNode){
			 var $this = $("#" + treeId);
			if($this.data("loadding")){
				return false;
			};
			$this.data("loadding", true);
			return true;
		},
               onAsyncSuccess : function(event, treeId, treeNode, msg) {
                        var  $this = $("#"+treeId),params = $this.data("params");
                        $this.data("isloaded",true);
                         $this.data("loadding",false);
                        if(params){
                             ztreeFunc.linkageControl(treeId,params);
                             $this.data("params",null);
                        }
               },
	},
	edit: {
		enable:{{editenable}},
		showRemoveBtn: {{showremovebtn}},
		removeTitle : ''删除'',
		showRenameBtn: {{showrenamebtn}},
		renameTitle : ''重命名'',
		drag:{
			isCopy: {{editdrag}}, 
			isMove: {{editdrag}},
		}
	},
	opts:{
		editPanleAutoClose:{{editpanleautoclose}},
		ruleId : ''{{ruleid}}'',
	},
});', 'data');
