				template:"#= {{shapgecontenttextname}} #",
	            fontSize:{{shapecontentfontsize}},
	            color:"{{shapecontentfontcolor}}"
			}
		},
		editable:{
            tools: {{editabletools}}
        },
		zoom: {{zoom}},
		zoomMax: {{zoommax}},
		zoomMin: {{zoommin}},
		click: {{clickfunction}}
	}
);

function visualTemplate(options){
	var dataviz = kendo.dataviz;
    var g = new dataviz.diagram.Group();
    var dataItem = options.dataItem;

    var width = dataItem.width?dataItem.width:{{shapewidth}};
    var height = dataItem.height?dataItem.height:{{shapeheight}};

    /*形状*/
    var shape = $.trim(dataItem.shape);
    if(shape){
    	if(shape=="rectangle"){
    		g.append(new dataviz.diagram.Rectangle({
		        width: width,
		        height: height,
		        stroke: {
		            width: 0
		        },
		        fill: {
		        	color:"{{shapecolor}}",
		        	opacity:"{{shapeopacity}}"

		        }
	    	}));
    	}
    	if(shape=="circle"){
    		g.append(new dataviz.diagram.Circle({
				width:width,
				height:height,
	            stroke: {
	                width:0
	            },
	            fill: "{{shapecolor}}"
	        }));
    	}
    	if(shape=="image"){
    		g.append(new dataviz.diagram.Image({
	            source: dataItem.image,
	            x: 3,
	            y: 3,
	            width: 50,
	            height: 50
	        }));
    	}
    }else{
    	if("rectangle"=="{{shapetype}}"){
			g.append(new dataviz.diagram.Rectangle({
		        width: width,
		        height: height,
		        stroke: {
		            width: 0
		        },
		        fill: {
		        	color:"{{shapecolor}}",
		        	opacity:"{{shapeopacity}}",
		        	gradient:{{isgradient}}?{
		        		type:"{{gradienttype}}",
		        		center:{{gradientcenter}},
                        start:{{gradientstart}},
                        end:{{gradientend}},
                        stops: [{
	                        color: "{{shapecolor}}",
	                        offset: 0,
	                        opacity: 0.2
	                    }, {
	                        color: "{{shapecolor}}",
	                        offset: 1,
	                        opacity: 1
	                    }]
		        	}:false
		        }
	    	}));
		}else if("circle"=="{{shapetype}}"){
			g.append(new dataviz.diagram.Circle({
				width:width,
				height:height,
	            stroke: {
	                width:0
	            },
	            fill: "{{shapecolor}}"
	        }));
		}
    }
    
    return g;
}

setTimeout(function(){
$("text").each(function(index, el) {
	if(index>0){
		$(this).css("writing-mode","{{writingmode}}");
		$(this).attr("transform","matrix(1,0,0,1,0,0)");
		if("{{writingmode}}"=="lr-tb"){
			$(this).attr("x",10);
			$(this).attr("y",{{shapeheight}}/2);
		}else{
			$(this).attr("x",{{shapewidth}}/2);
			$(this).attr("y",10);
		}
	}
});
},1000);
', 'data');
