INSERT INTO FORM_TEMPLATE (ID_, COMPONENTID_, CREATEBY_, CREATEDATE_, DELETEFLAG_, NAME_, TEMPLATE_, TYPE_) VALUES (3438, 2350, 'admin', '2016-03-23 14:01:05', 0, 'data', '$(''#{{id}} #fileupload'').fileupload({
