INSERT INTO FORM_TEMPLATE (ID_, COMPONENTID_, CREATEBY_, CREATEDATE_, DELETEFLAG_, NAME_, TEMPLATE_, TYPE_) VALUES (3539, 2550, 'admin', '2016-03-23 16:15:25', 0, 'data', 'var uploadButton = $(''<button/>'')
.addClass(''btn btn-primary upload'')
.prop(''disabled'', true)
.text(''正在上传...'')
.on(''click'', function () {
    setTimeout(function(){
         $(''#progress .progress-bar'').css(''width'', ''0'');
    }, 3000);
    var $this = $(this), data = $this.data();
    $this
        .off(''click'')
        .text(''中止'')
        .on(''click'', function () {
            $this.remove();
            data.abort();
        });
    data.submit().always(function () {
        $this.remove();
    });
});
var cancelButton = $(''<button/>'')
.addClass(''btn btn-danger cancel'')
.text(''取消'')
.on(''click'', function () {
    var $this = $(this), data = $this.data();
    $this.closest(''div'').remove();
    data.abort();
});
$(''#{{id}} #fileupload'').fileupload({
    url: ''{{saveurl}}'',
    dataType: ''json'',
    autoUpload: false,
    acceptFileTypes: {{fileextensionvalue}},
    maxFileSize: 999000,
    disableImageResize: /Android(?!.*Chrome)|Opera/.test(window.navigator.userAgent),
    previewMaxWidth: 100,
    previewMaxHeight: 100,
    previewCrop: true
}).on(''fileuploadadd'', function (e, data) {
    data.context = $(''<div/>'').appendTo(''#files'');
    $.each(data.files, function (index, file) {
        var node = $(''<p/>'')
                .append($(''<span/>'').text(file.name));
        if (!index) {
            node
                .append(''<br>'')
                .append(uploadButton.clone(true).data(data))
                .append(cancelButton.clone(true).data(data));
                
        }
        node.appendTo(data.context);
    });
}).on(''fileuploadprocessalways'', function (e, data) {
    var index = data.index,
        file = data.files[index],
        node = $(data.context.children()[index]);
    if (file.preview) {
        node
            .prepend(''<br>'')
            .prepend(file.preview);
    }
    if (file.error) {
        node
            .append(''<br>'')
            .append($(''<span class="text-danger"/>'').text(file.error));
    }
    if (index + 1 === data.files.length) {
        data.context.find(''button.upload'')
            .text(''上传'')
            .prop(''disabled'', !!data.files.error);
    }
}).on(''fileuploadprogressall'', function (e, data) {
    var progress = parseInt(data.loaded / data.total * 100, 10);
    $(''#progress .progress-bar'').css(
        ''width'',
        progress + ''%''
    );
}).on(''fileuploaddone'', function (e, data) {
    $.each(data.result, function (index, file) {
        if (file.error) {
            var error = $(''<span class="text-danger"/>'').text(file.error);
            $(data.context.children()[index])
                .append(''<br>'')
                .append(error);
        }else{
            var $tg = $(data.context.children()[index]);
            $tg.find(''button.cancel'').remove();
            var url = ''{{downloadurl}}''+''&id=''+file.id;
            var link = $(''<a>'')
                    .attr(''target'', ''_blank'')
                    .prop(''href'', url);
            $tg.wrap(link);
            $(''#{{id}}'').data(''saveId'', file.id);
        }
    });
}).on(''fileuploadfail'', function (e, data) {
    $.each(data.files, function (index) {
        var error = $(''<span class="text-danger"/>'').text(''文件上传失败！'');
        $(data.context.children()[index])
            .append(''<br>'')
            .append(error);
    });
    $(''#{{id}}'').data(''saveId'', 0);
}).prop(''disabled'', !$.support.fileInput)
.parent().addClass($.support.fileInput ? undefined : ''disabled'');', 'data');
