INSERT INTO FORM_TEMPLATE (ID_, COMPONENTID_, CREATEBY_, CREATEDATE_, DELETEFLAG_, NAME_, TEMPLATE_, TYPE_) VALUES (6438, 4250, 'admin', '2016-05-10 10:45:23', 0, 'gridData', 'jQuery("#{{id}}").grid({
	columns : {{columns}},
	ajax : {
		read : {
			url : contextPath+"/mx/form/data/gridData",
			async : true,
			data : {
				rid:''{{ruleid}}''
		    },
			success : function(ret){
				if(ret){
					return {
						total : ret.total,
						rows : ret.data
					}
				} else {
