INSERT INTO FORM_TEMPLATE (ID_, COMPONENTID_, CREATEBY_, CREATEDATE_, DELETEFLAG_, NAME_, TEMPLATE_, TYPE_) VALUES (8938, 5150, 'admin', '2016-07-06 17:59:05', 0, 'data', 'pubsub.pub('''',{"{{id}}":[{"inid":"{{id}}","type":"init"}]},
	{
      ''rid'': ''{{ruleid}}'',
      ''nodeID'': ''index_id'',
      ''CContent'': {{showcontent}},
      ''pan'': {{pan}},
      ''zoom'': {{zoom}},
      ''toggleSiblingsResp'': true,
      ''direction'': ''{{subtype}}'',
      ''DDepth'': ''{{depth}}'',
      ''draggable'': {{drag}},
      ''parentNodeSymbol'': '''',
      ''createNode'': function($node, data) {

	      	if({{showimage}}){
	      		var secondMenuIcon = $(''<i>'', {''class'': ''fa fa-info-circle second-menu-icon'',
	                            		click: function() {$(this).siblings(''.second-menu'').toggle();}
	          						});
	            if(data.imageName){
	      			var secondMenu = ''<div class="second-menu"><img class="avatar" src="../attachment?method=download&from=to_db&id=''+data.imageName+''"/></div>'';
	            	$node.append(secondMenuIcon).append(secondMenu);
	      		}else{
	      			$node.append(secondMenuIcon);
	      		}
	      	}

	      	if(''{{shapetype}}''=="rectangle"){
	      	}else if(''{{shapetype}}''=="radius"){
	      		if({{showcontent}}){
	      			$node.find(".title").addClass("top-circle");
	      			$node.find(".content").addClass("bottom-circle");
	      		}else{
	      			$node.find(".title").addClass("circle");
	      		}		
	      	}

	      	if({{shapewidth}}){
	      		$node.css("width",{{shapewidth}}+"px");
	      	}

	      	if({{shapeheight}}&&{{showcontent}}){
	      		$node.find(".title").css("white-space","normal").css("height",{{shapeheight}}+"px").css("line-height",{{shapeheight}}+"px");
	      		$node.find(".content").css("white-space","normal").css("height",{{contentheight}}+"px").css("line-height",{{contentheight}}+"px");
	      	}else if({{shapeheight}}){
	      		$node.find(".title").css("height",{{shapeheight}}+"px").css("line-height",{{shapeheight}}+"px");
	      	}

	      	if(''{{shapecolor}}''){
				$node.find(".title").css("background-color",''{{shapecolor}}'');
        		$node.find(".content").css("border-color",''{{shapecolor}}'');
        	}

	        if({{showcontent}}){
	        }else{
	      	 	$node.addClass("nocontent");
	        }
      },
      ''dropCriteria'': function($draggedNode, $dragZone, $dropZone) {
        if($draggedNode.find(''.content'').text().indexOf(''manager'') > -1 && $dropZone.find(''.content'').text().indexOf(''engineer'') > -1) {
          return false;
        }
        return true;
      }
    }
);', 'data');
